import React from "react";
import videoImg1 from "../assets/Video_Image_1.jpeg";
import videoImg2 from "../assets/Video_Img_2.jpeg";
import videoImg3 from "../assets/Video_Img_3.jpeg";

const VideoList = () => {
  return (
    <section className="main-video-content">
      <div>
        <img className="videoThumbnail" src={videoImg1} alt="thumbnail"></img>
        <div>
          <h4>Title:</h4>
          <h5>Description: </h5>
        </div>
      </div>
      <div>
        <img className="videoThumbnail" src={videoImg2} alt="thumbnail"></img>
        <div>
          <h4>Title:</h4>
          <h5>Description: </h5>
        </div>
      </div>
      <div>
        <img className="videoThumbnail" src={videoImg3} alt="thumbnail"></img>
        <div className="thumb-na">
          <h4>Title:</h4>
          <h5>Description: </h5>
        </div>
      </div>
    </section>
  );
};

export default VideoList;
